import React from "react";
import { Form } from "antd";

const NicknameEditForm = () => {
  return (
    <div>
      <Form
        style={{
          marginBottom: "20px",
          border: "1px solid #d9d9d9",
          padding: "20px",
        }}
      ></Form>
    </div>
  );
};

export default NicknameEditForm;
